import { Box, Typography, List, ListItem, IconButton, ListItemAvatar, ListItemText, Avatar, Divider } from "@mui/material"
import DeleteIcon from '@mui/icons-material/Delete';

const MealPlan = ({ item }) => {
    return (
        <ListItem sx={{ backgroundColor: 'primary.main', border: 'solid 3px', borderColor: 'primary.main', my: '0.5rem', borderRadius: '10px', mx: 'auto', width: '80%',height:'2rem' }}
            secondaryAction={
                <IconButton edge="end" aria-label="delete">
                    <DeleteIcon sx={{ color: 'black' }} />
                </IconButton>
            }
        >
            <ListItemText
                primary="Single-line item"
                disableTypography
                sx={{ color: 'background.paper', fontFamily: 'Roboto', fontWeight: '900' }}
            />
        </ListItem>
    )
}

export default MealPlan
